    if ( ! b->yy_ch_buf )
        YY_FATAL_ERROR( "out of dynamic memory in hsql__create_buffer()" );

    b->yy_is_our_buffer = 1;

    hsql__init_buffer(b, file , yyscanner);

    return b;
